import { defineStore, acceptHMRUpdate } from 'pinia';
import { LocalStorage } from 'quasar';
import { ref, watch } from 'vue';
import debounce from 'lodash.debounce';
import { StorageKey } from 'src/constants/storageKeys';

const STORAGE_KEY = StorageKey.BACKGROUND_CONFIG;

const DEFAULT_CONFIG = {
  blurLevel: '0px',
  image:
    'data:image/png;base64,',
};

export const useBackgroundStore = defineStore('background', () => {
  const config = ref<typeof DEFAULT_CONFIG>();
  function resetToDefault() {
    config.value = {
      ...DEFAULT_CONFIG,
    };
  }
  function saveToStorage() {
    LocalStorage.setItem(STORAGE_KEY, config.value);
  }

  const isInitialized = ref(false);
  function initialize() {
    if (isInitialized.value) return;
    try {
      const stored = LocalStorage.getItem(STORAGE_KEY) as typeof DEFAULT_CONFIG;
      if (stored) {
        config.value = stored;
      } else {
        resetToDefault();
        saveToStorage();
      }
    } catch (e) {
      console.error('Load background config failed:', e);
      resetToDefault();
      saveToStorage();
    }
    isInitialized.value = true;
  }

  initialize();

  const debouncedSave = debounce(saveToStorage, 500); // 500ms
  watch(
    config,
    () => {
      debouncedSave();
    },
    { deep: true },
  );
  return { config, resetToDefault };
});

if (import.meta.hot) {
  import.meta.hot.accept(acceptHMRUpdate(useBackgroundStore, import.meta.hot));
}
